function Footer(){
    return (
        <div className= "footer">
            <div className="image_footer">
                <img></img>
            </div>
            <div className="text_footer">
            <div className="links_colums">
                <div className="link">
                <i class="fa-solid fa-chevron-right"></i>
                <p>Test</p>
                </div>
            </div>
        </div>
        </div>
    );
};

export default Footer;
